def latencyCdf(ldf:Dataset[Row], numpoints:Integer): (Array[Double], Array[Double]) = {
    val ldfcount = ldf.count();
    val n = if (numpoints > 0) numpoints+1 else ldfcount+1
    val incr = if (numpoints > 0) math.ceil(ldfcount.toDouble/numpoints).toInt else 1;
    val cdfx = new Array[Double] (n.toInt);
    val cdfy = new Array[Double] (n.toInt);
    val ldfs = ldf.orderBy("latency").collect.map(x => x.getDouble(0));

    var i = 0;
    var bin = 0;
    println(incr)
    ldfs.foreach( x => {
        //println(""+i+"\t"+bin)
        if ((i % incr) == 0) {
            cdfx(bin) = x;
            cdfy(bin) = i.toDouble/ldfcount.toDouble;
            bin += 1;
        }
        i += 1;
    })

    return (cdfx, cdfy)
}

def experimentPaths(jpcap:Dataset[Row], start:Int, end:Int): Array[Map[String,Any]] = {
    return jpcap.filter($"dst.timestamp".isNotNull).select(concat_ws(" ", lit("dst:"), $"src", lit("->"), $"dst"), $"tasknum", $"dst.timestamp".as("timestamp"))
    .union(jpcap.select(concat_ws(" ", lit("src:"), $"src", lit("->"), $"dst"), $"tasknum", $"src.timestamp".as("timestamp"))).orderBy("tasknum")
    .collect().map( x => Map("ip"->x.getString(0), "pktnum"->x.getInt(1), "t"->x.getDouble(2)))
    .slice(start,end)
}

def experimentPaths(jpcap:Dataset[Row], start:Int, end:Int): Array[Map[String,Any]] = {
    return jpcap.filter($"dst.timestamp".isNotNull).select($"dst", $"tasknum", $"dst.timestamp".as("timestamp"))
    .union(jpcap.select($"src", $"tasknum", $"src.timestamp".as("timestamp"))).orderBy("tasknum")
    .collect().map( x => Map("ip"->x.getString(0), "pktnum"->x.getInt(1), "t"->x.getDouble(2)))
    .slice(start,end)
}

def experimentPathsOld2(jpcap:Dataset[Row]): (Map[String,Array[(Int,Double)]], Map[String,Array[Double]]) = {
    val src_paths = scala.collection.mutable.Map.empty[String,Array[(Int,Double)]]
    val dst_paths = scala.collection.mutable.Map.empty[String,Array[Double]]

    // first we collect the experiment paths for the sources
    val src_ips = jpcap.select("src").distinct.collect.map( x => x.getString(0) )
    println("src_ips = "+src_ips)
    for (src_ip <- src_ips) {
        src_paths += (src_ip -> jpcap.filter($"src"===src_ip).orderBy("tasknum").select("tasknum", "src.timestamp").collect().map( x => (x.getInt(0), x.getDouble(1)) ).sortBy(_._1))
    }

    // next collect the experiment paths for the destinations
    val dst_ips = jpcap.select("dst").distinct.collect.map( x => x.getString(0) )
    println("dst_ips = "+dst_ips)
    for (dst_ip <- dst_ips) {
        dst_paths += (dst_ip -> jpcap.filter($"dst.timestamp".isNotNull).filter($"dst"===dst_ip).orderBy("tasknum").select("dst.timestamp").collect().map( x => x.getDouble(0) ))
    }

    // trick to return immutables
    return (Map() ++ src_paths, Map() ++ dst_paths)
}

def experimentPathsOld(jpcap:Dataset[Row]): (Map[String,Array[Double]], Map[String,Array[Double]]) = {
    val src_paths = scala.collection.mutable.Map.empty[String,Array[Double]]
    val dst_paths = scala.collection.mutable.Map.empty[String,Array[Double]]

    // first we collect the experiment paths for the sources
    val src_ips = jpcap.select("src").distinct.collect.map( x => x.getString(0) )
    for (src_ip <- src_ips) {
        src_paths += (src_ip -> jpcap.filter($"src"===src_ip).select("src.timestamp").orderBy("src.timestamp").collect().map( x => x.getDouble(0) ))
    }

    // next collect the experiment paths for the destinations
    val dst_ips = jpcap.select("dst").distinct.collect.map( x => x.getString(0) )
    for (dst_ip <- dst_ips) {
        dst_paths += (dst_ip -> jpcap.filter($"dst"===dst_ip).select("dst.timestamp").orderBy("dst.timestamp").collect().map( x => x.getDouble(0) ))
    }

    // trick to return immutables
    return (Map() ++ src_paths, Map() ++ dst_paths)
}

